import React from 'react';
import '../components/design-files-css/SideMenu.css';
import { Link } from 'react-router-dom';

const SideMenuComponent = () => {

  const history = useHistory();

  const handleLogout = () => {
    // Perform the logout operation here, e.g., clearing a token or session.

    // After performing the logout operation, redirect to the login page.
    history.push('/');
  };

  return (
    <div className="side-menu">
      <ul>
        <li><Link to="/login" className="nav-button">Login</Link></li>
        <li><Link to="/signup" className="nav-button">Signup</Link></li>
        <li><Link to="/" className="nav-button" onClick={handleLogout}>Home</Link></li>
      </ul>
    </div>
  );
};

export default SideMenuComponent;
